if mibBuilder.loadTexts: rdbmsSrvInfoTable.setDescription("The table of additional information about database servers. Entries in this table correspond to applications in the APPLICATION-MIB applTable. Some objects in that table are application-specific. When they are associated with an RDBMS server in this table, the objects have the following meanings. applName - The name of this server, i.e., the process or group of processes providing access to this database. The exact format will be product and host specific. applVersion - The version number of this server, in product specific format. applOperStatus - up(1) means operational and available for general use. down(2) means the server is not available for use, but is known to the agent. The other states have broad meaning, and may need to be supplemented by the vendor private MIB. Halted(3) implies an administrative state of unavailability. Congested(4) implies a resource or or administrative limit is prohibiting new inbound associations. The 'available soon' description of restarting(5) may include an indeterminate amount of recovery. applLastChange is the time the agent noticed the most recent change to applOperStatus. applInboundAssociation is the number of currently active local and remote conversations (usually SQL connects). applOutboundAssociations is not provided by this MIB. applAccumulatedInboundAssociations is the total number of local and remote conversations started since the server came up. applAccumulatedOutbound associations is not provided by this MIB. applLastInboundActivity is the time the most recent local or remote conversation was attempted or disconnected. applLastOutboundActivity is not provided by this MIB. applRejectedInboundAssociations is the number of local or remote conversations rejected by the server for administrative reasons or because of resource limitations. applFailedOutboundAssociations is not provided by this MIB.")
